{
  "translationLines": [
    {
      "lineNumber": 62421,
      "originalJapaneseLine": "　どちらかというと、嫌です……」",
      "translatedEnglishLine": "If I had to say, I don't like it..."
    },
    {
      "lineNumber": 62422,
      "originalJapaneseLine": "「ねーー」",
      "translatedEnglishLine": "Right?"
    },
    {
      "lineNumber": 62423,
      "originalJapaneseLine": "「むう……こいつらはただ頑丈なだけの",
      "translatedEnglishLine": "Hmm... These guys might just be tough,"
    },
    {
      "lineNumber": 62424,
      "originalJapaneseLine": "　可能性があるからよく分からんな……」",
      "translatedEnglishLine": "so I don't really understand..."
    },
    {
      "lineNumber": 62425,
      "originalJapaneseLine": "「次、気持ちいいと思う奴！」",
      "translatedEnglishLine": "Next, whoever feels good!"
    },
    {
      "lineNumber": 62426,
      "originalJapaneseLine": "「全然平気ーーー！」",
      "translatedEnglishLine": "I'm totally fine!"
    },
    {
      "lineNumber": 62427,
      "originalJapaneseLine": "「ねーー♪　いい音」",
      "translatedEnglishLine": "Right♪ Nice sound."
    },
    {
      "lineNumber": 62428,
      "originalJapaneseLine": "「まったく平気なのれす！」",
      "translatedEnglishLine": "I'm completely fine!"
    },
    {
      "lineNumber": 62429,
      "originalJapaneseLine": "「私も。こうなると……肉体の年齢……かな」",
      "translatedEnglishLine": "Me too. At this point... maybe it's about physical age..."
    },
    {
      "lineNumber": 62430,
      "originalJapaneseLine": "「ガキなら平気って事か」",
      "translatedEnglishLine": "So it means kids are fine with it?"
    },
    {
      "lineNumber": 62431,
      "originalJapaneseLine": "「そういう事かもしれんなぁ。",
      "translatedEnglishLine": "That might be it."
    },
    {
      "lineNumber": 62432,
      "originalJapaneseLine": "　けっ、感じの悪い花やで」",
      "translatedEnglishLine": "Tch, what an unpleasant flower."
    },
    {
      "lineNumber": 62433,
      "originalJapaneseLine": "（ああ……私、まだ気持ちいい……",
      "translatedEnglishLine": "(Ah... I'm still feeling good..."
    },
    {
      "lineNumber": 62434,
      "originalJapaneseLine": "　こ、子供……なのかな……）",
      "translatedEnglishLine": "A-Am I... a child... I wonder...)"
    },
    {
      "lineNumber": 62435,
      "originalJapaneseLine": "「あちゃ、私もまだ平気だ……",
      "translatedEnglishLine": "Oops, I'm still fine too..."
    },
    {
      "lineNumber": 62436,
      "originalJapaneseLine": "　ま、気持ち悪いよりはいいか」",
      "translatedEnglishLine": "Well, it's better than feeling sick."
    },
    {
      "lineNumber": 62437,
      "originalJapaneseLine": "「もしかしたら、この辺りは小さい子たちを",
      "translatedEnglishLine": "Maybe, around here, it’s better to focus on the smaller kids"
    },
    {
      "lineNumber": 62438,
      "originalJapaneseLine": "　中心にした方がいいかもしれませんね」",
      "translatedEnglishLine": "as the main group."
    },
    {
      "lineNumber": 62439,
      "originalJapaneseLine": "「ふん、どうするかな……",
      "translatedEnglishLine": "Hmph, what should we do..."
    },
    {
      "lineNumber": 62440,
      "originalJapaneseLine": "　まあいい、進むぞ」",
      "translatedEnglishLine": "Well, whatever, let's move on."
    },
    {
      "lineNumber": 62441,
      "originalJapaneseLine": "自由都市のひとつ、小都市ナルメル――",
      "translatedEnglishLine": "One of the free cities, the small city of Narmel—"
    },
    {
      "lineNumber": 62442,
      "originalJapaneseLine": "大通りに、ぎらぎらと輝くものが",
      "translatedEnglishLine": "On the main street, something was shining brightly"
    },
    {
      "lineNumber": 62443,
      "originalJapaneseLine": "うずたかく積み上げられていた。",
      "translatedEnglishLine": "and piled up high."
    },
    {
      "lineNumber": 62444,
      "originalJapaneseLine": "「ピサロ閣下！",
      "translatedEnglishLine": "Lord Pizarro!"
    },
    {
      "lineNumber": 62445,
      "originalJapaneseLine": "　この町では、どうやらこれくらいのようです」",
      "translatedEnglishLine": "It seems this is about all we found in this town."
    },
    {
      "lineNumber": 62446,
      "originalJapaneseLine": "「んむふふふふ。ご苦労。",
      "translatedEnglishLine": "Hmm, hehehe. Well done."
    },
    {
      "lineNumber": 62447,
      "originalJapaneseLine": "　町の大きさの割には、まあまあだな」",
      "translatedEnglishLine": "For a town this size, it's not bad."
    },
    {
      "lineNumber": 62448,
      "originalJapaneseLine": "上機嫌を隠そうともせず、",
      "translatedEnglishLine": "Without even trying to hide his good mood,"
    },
    {
      "lineNumber": 62449,
      "originalJapaneseLine": "舌なめずりしそうな表情でピサロは頷いた。",
      "translatedEnglishLine": "Pizarro nodded with a mouth-watering expression."
    },
    {
      "lineNumber": 62450,
      "originalJapaneseLine": "積み上がっているのは、町から徹底的に略奪された",
      "translatedEnglishLine": "What was piled up were treasures thoroughly looted from the town,"
    },
    {
      "lineNumber": 62451,
      "originalJapaneseLine": "宝飾品や、金銀財宝だ。",
      "translatedEnglishLine": "jewelry and gold and silver treasures."
    },
    {
      "lineNumber": 62452,
      "originalJapaneseLine": "指輪、腕輪、首飾り。GOLDのプレートもある。",
      "translatedEnglishLine": "Rings, bracelets, necklaces. There were also gold plates."
    },
    {
      "lineNumber": 62453,
      "originalJapaneseLine": "これらは全て、大将軍ピサロの手に収まる。",
      "translatedEnglishLine": "All of these ended up in Great General Pizarro's hands."
    },
    {
      "lineNumber": 62454,
      "originalJapaneseLine": "「閣下！　こちらの絵はいかがされましょう？",
      "translatedEnglishLine": "Your Excellency! What shall we do with this painting?"
    },
    {
      "lineNumber": 62455,
      "originalJapaneseLine": "　人間どもによると、5000万GOLDほどするそうです」",
      "translatedEnglishLine": "According to the humans, it’s worth about 50 million GOLD."
    },
    {
      "lineNumber": 62456,
      "originalJapaneseLine": "「んあ？　そんなもんはどうでもいい。燃やせ」",
      "translatedEnglishLine": "Huh? That kind of thing doesn't matter. Burn it."
    },
    {
      "lineNumber": 62457,
      "originalJapaneseLine": "「閣下！　こちらの神像は……」",
      "translatedEnglishLine": "Your Excellency! How about this statue of a deity...?"
    },
    {
      "lineNumber": 62458,
      "originalJapaneseLine": "「金箔は剥がしておけ。後は引き倒して破壊しろ」",
      "translatedEnglishLine": "Peel off the gold leaf. Then topple it and destroy the rest."
    },
    {
      "lineNumber": 62459,
      "originalJapaneseLine": "ひとつひとつ、ピサロは破壊するものと奪うものに",
      "translatedEnglishLine": "One by one, Pizarro gave instructions on what to destroy and what to take."
    },
    {
      "lineNumber": 62460,
      "originalJapaneseLine": "指示を下していく。",
      "translatedEnglishLine": "He gave his orders accordingly."
    },
    {
      "lineNumber": 62461,
      "originalJapaneseLine": "「…………んんむぅ？　これは……」",
      "translatedEnglishLine": "Hmm? What is this...?"
    },
    {
      "lineNumber": 62462,
      "originalJapaneseLine": "ピサロの視線が、財宝の中の板状の物体に",
      "translatedEnglishLine": "Pizarro's gaze was drawn to a flat object among the treasures."
    },
    {
      "lineNumber": 62463,
      "originalJapaneseLine": "吸い込まれた。",
      "translatedEnglishLine": "He was captivated by it."
    },
    {
      "lineNumber": 62464,
      "originalJapaneseLine": "「うむむむ……素晴らしい……",
      "translatedEnglishLine": "Umm... Wonderful..."
    },
    {
      "lineNumber": 62465,
      "originalJapaneseLine": "　これは金を絵の具に溶いているのか……」",
      "translatedEnglishLine": "Is this gold dissolved into the paint...?"
    },
    {
      "lineNumber": 62466,
      "originalJapaneseLine": "「あ、それですか？　ビョウブとかいう、",
      "translatedEnglishLine": "Ah, that? It's called a 'Byōbu',"
    },
    {
      "lineNumber": 62467,
      "originalJapaneseLine": "　JAPANのパーティションらしいですが」",
      "translatedEnglishLine": "a partition from JAPAN, apparently."
    },
    {
      "lineNumber": 62468,
      "originalJapaneseLine": "芸術など一切解さないピサロも、",
      "translatedEnglishLine": "Even Pizarro, who doesn't understand art at all,"
    },
    {
      "lineNumber": 62469,
      "originalJapaneseLine": "金屏風の豪奢な美にはうなり声を上げた。",
      "translatedEnglishLine": "let out a groan at the luxurious beauty of the golden folding screen."
    },
    {
      "lineNumber": 62470,
      "originalJapaneseLine": "「JAPANか……聞く所によれば、",
      "translatedEnglishLine": "Japan, huh... From what I’ve heard,"
    }
  ]
}

